$templateCache.put("templates/app/public.doc.proposal.html","<ion-modal-view class=doc id=proposal-doc><ion-header-bar class=bar-assertive><h1 class=title>大圣保险 单次投保产品告知</h1></ion-header-bar><ion-content overflow-scroll=true class=i-scroll><div class=\"wrapper has-footer\"><div class=scroller><div><p class=bold ng-click=test()>尊敬的用户：</p><p>为了充分保障您的权利，请您投保前仔细阅读此界面，若有不确定或不清楚的地方请直接联系我司在线客户，以免造成您不必要的麻烦或损失。</p><p>适用条款：<span ng-show=proposal.isZR>《中国太平洋财产保险股份有限公司公路货物运输承运人责任保险》</span><span ng-show=!proposal.isZR>《中国太平洋财产保险股份有限公司国内水路、陆路货物运输保险条款》</span>险别：<span ng-show=proposal.isZR>责任险</span><span ng-show=proposal.isZh>综合险</span><span ng-show=\"!proposal.isZR && !proposal.isZh\">基本险</span>。</p><p class=bold>我们承保的货物类别分为以下四类，投保时请务必正确选择货物种类，如果涉及需要加费的货物，而您投保时未选择加费类别，我司对此类交易不承担任何赔偿责任。</p><p class=bold ng-show=\"proposal.payCouponId!==undefined\">优惠券投保我司仅承保I类货物。II类货物、III类货物、IV类货物均不属于优惠券承保的货物类别。</p><p>货物分为四类：</p><p>I类货物——即普通货物，不加费；</p><p>II类货物——包括药品、保健品、医疗器械、乐器、易碎品、国内无法定损或修复的精密仪器、家具（红木家具属于不保范围），投保时需要在原保费基础上加费50%后可承保；</p><p>III类货物——军用品，在原保费基础上加费100%后可承保；</p><p>IV类货物——烟花爆竹等易燃易爆品，在原保费基础上加费400%后可承保；</p><p class=bold>我司不保的货物或者风险：</p><p>1、武器弹药、现金、支票、票据、单证、有价证券、信用证、护照、卫星运送过程中遭受的风险；</p><p>2、货物运输过程中遭受的核子能、原子能风险，放射性沾染风险，政治、财政、信用风险；</p><p>3、工艺品、金银、珠宝、钻石、手表、玉器、字画、文物古玩等贵重物品运送过程中遭受的风险；</p><p>4、鲜活货、动植物和血制品；</p><p>5、红木及其制品（红木包括紫檀木类、花梨木类、香枝木类、黑酸枝类、红酸枝木类、乌木类、条纹乌木类和鸡翅木类）；</p><p>6、没有包装的散装货、没有包装及包装不善的易碎品；</p><p>7、成品车；</p><p>8、超高、超宽、超长、超重的大件货物；</p><p class=bold>限制承保责任的货物：</p><p>1、二手货物，只承保由于火灾爆炸导致的直接损失；</p><p>2、二程运输（即进口段已经另行投保，仅将后半段国内运输向我司办理投保的业务），只承保基本险的保险范畴；</p><p>3、手机、平板电脑、笔记本电脑、相机、手表等便携式电子产品或贵重物品，不承担被盗窃、被抢劫、神秘失踪及提货不着引起的任何损失；</p></div></div></div></ion-content><div class=\"bar bar-footer bar-stable\"><button class=\"button button-clear button-assertive\" ng-click=rejectDoc()>不同意</button> <button class=\"button button-clear button-assertive\" ng-click=acceptDoc()>同意</button></div></ion-modal-view>");
